import Vue from "vue"; // Importuj Vue
import VueRouter from "vue-router";

import PLKComponent from "../views/Plk.vue";

Vue.use(VueRouter);

const routes = [
  {
    path: "/plk",
    name: "PLK",
    component: PLKComponent,
  },
];

const router = new VueRouter({
  routes,
  mode: "history",
});

export default router;
